import React from 'react';
import { withAuthConsumer } from '../../contexts/AuthStore';
class Student extends Component {
 render() {

  return (
    <div className="student">
      <img className="avatar-card" src="./1.png" alt=""/>
      <span className="avatar-points">10</span>
      <div className="card">
        <div className="card-p">
          <p className="card-name">{this.props.classroom.student[0].name}</p>
          <p className="card-surname">Apellidos</p>
        </div>
      </div>
    </div>
);
}}

export default withAuthConsumer()
